import React from 'react';

const SkillTree = () => {
  const skills = [
    { name: 'Project Management', level: 80, icon: 'üéØ', master: false },
    { name: 'Augmented Reality', level: 95, icon: 'üîÆ', master: true },
    { name: 'Design Patterns', level: 85, icon: 'üèóÔ∏è', master: false },
    { name: 'Virtual Reality', level: 90, icon: 'ü•Ω', master: true },
    { name: 'Multiplayer', level: 88, icon: 'üåê', master: false },
    { name: 'Unity', level: 95, icon: 'üéÆ', master: true },
    { name: 'Game Design', level: 85, icon: 'üé®', master: false }
  ];

  return (
    <section id="mini-games" className="game-section skill-tree">
      <div className="container">
        <h2 className="section-title">Skill Tree</h2>
        <div className="skills-unlocked">
          {skills.map((skill) => (
            <div key={skill.name} className={`skill-node unlocked ${skill.master ? 'master' : ''}`}>
              <div className="skill-icon">{skill.icon}</div>
              <div className="skill-name">{skill.name}</div>
              <div className="skill-level">Level {skill.level}</div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SkillTree;
